import './App.css';
import Button from '@material-ui/core/Button';
import Navbar from './component/Navbar';
import { Route, BrowserRouter, Link } from 'react-router-dom';
import { createMuiTheme } from '@material-ui/core/styles';


export const customTheme = createMuiTheme({
  palette: {
    primary: {
      light: '#000',
      main: '#000',
      dark: '#000',
      contrastText: '#000'
    },
    secondary: {
      light: '#000',
      main: '#000',
      dark: '#000',
      contrastText: '#000',
    },
    error: {
      main: '#000',
      light: '#000',
      dark: '#000',
      contrastText: '#000',
    },
    divider: '#000',
    action: {
      active: '#000',
      hover: '#000',
      selected: '#000',
      disabled: '#000',
      disabledBackground: '#000',
    },
    text: {
      primary: '#000',
      secondary: '#000',
      disabled: '#000',
      hint: '#000',
      icon: '#000',
    },
    common: {
      black: '#000',
      white: '#000',
    },
    background: {
      default: '#000',
      paper: '#000',
    },
  },
});


function App() {
  return (
    <div className="App">
      <Navbar/>
{/*       <BrowserRouter>
        <Route path = "/login" component = { Login } />
        <h1><Link to ="/login">LOGIN</Link></h1>
      </BrowserRouter>

      <h1>Cost Benefit Analysis</h1>
      <Button variant="contained">Registration</Button> */}

    </div>
  );
}

export default App;
